		var slowDuration = 3000; // 3 ثوانٍ بالمللي ثانية
		
		// إيقاف الإطار الزمني في البداية
		this.stop();
		
		// دالة تحديث حالة التايمر
		function updateTimerState(event) {
		  // حساب المسافة بين العنصرين
		  var dx = movingElement.x - staticElement.x;
		  var dy = movingElement.y - staticElement.y;
		  var distance = Math.sqrt(dx * dx + dy * dy);
		
		  // إذا كانت المسافة أقل من حد معين، قم بتشغيل التايمر
		  if (distance < activationDistance) {
		    if (!timerRunning) {
		      this.play();
		      timerRunning = true;
		      elapsedTime = 0;
		    } else {
		      elapsedTime += event.delta;
		
		      // إذا كان الوقت المنقضي أقل من مدة التشغيل البطيء، قم بتشغيل التايمر بسرعة بطيئة
		      if (elapsedTime < slowDuration) {
		        this.frameRate = 10; // يمكنك تعديل هذه القيمة لضبط السرعة البطيئة
		      } else {
		        // بعد انتهاء مدة التشغيل البطيء، قم بتشغيل التايمر بالسرعة العادية
		        this.frameRate = 30; // أو أي قيمة أخرى للسرعة العادية
		      }
		    }
		  } else {
		    // إذا كانت المسافة أكبر من الحد، قم بإيقاف التايمر
		    if (timerRunning) {
		      this.stop();
		      timerRunning = false;
		      this.frameRate = 30; // إعادة السرعة إلى القيمة العادية
		    }
		  }
		
		  // التحقق من الوصول إلى الإطار الأخير
		  if (timerRunning && this.currentFrame === this.timeline.duration - 1) {
		    this.stop();
		    timerRunning = false;
		  }
		}
		
		// مستمعات أحداث الماوس للعنصر المتحرك
		movingElement.on("mousedown", function(event) {
		  isDragging = true;
		  movingElement.offset = {x: movingElement.x - event.stageX, y: movingElement.y - event.stageY};
		});
		
		movingElement.on("pressmove", function(event) {
		  if (isDragging) {
		    movingElement.x = event.stageX + movingElement.offset.x;
		    movingElement.y = event.stageY + movingElement.offset.y;
		  }
		});
		
